import React from 'react'

function ClubDetail({ pickedClub }) {
    return (
        <div className='lg:w-3/5 w-5/5 mx-3 rounded overflow-hidden shadow-[0_2px_10px] shadow-blackA7 bg-slate-800 border text-white'>
            <h1 className='text-center text-2xl'>
                Münazara Kulübü
            </h1>
        </div>
    )
}

export default ClubDetail
